import React from 'react';


const ShowStudents = () => {
    

    return (
        <div >
            <table>
                <th>Student ID</th>
                <th>Name</th>
                <th>Surname</th>
                <th>Mark</th>
                <th>Presence</th>
                <th>Time</th>
            </table>
        </div>

    )
}
export default ShowStudents
